impl Solution {
    pub fn longest_valid_substring(word: String, forbidden: Vec<String>) -> i32 {
        let mut result = 0;
        let mut left = 0;
        let word_len = word.len();
        'outer: while left < word_len {
            for right in (left + result + 1..=word_len).rev() {
                let substring = &word[left..right];
                for f in &forbidden {
                    if substring.contains(f) {
                        continue 'outer;
                    }
                }
                result = result.max(right - left);
                break;
            }
            left += 1;
        }
        result as i32
    }
}
